import React, { Component } from 'react'
import { Map, GoogleApiWrapper, Marker } from 'google-maps-react';

const style = {
    width: '50%',
    height: '50%',
    borderColor: "red",
    border: "50px",
    display:"flex"
  };


export class MapContainer extends Component {

  // let beachesArray = this.props.beaches


  // this.setState({})


  state = {
    beaches:[{lat: 40.5726046, lng: -73.9787857},
            {lat: 40.5721302, lng: -73.9793298},
            {lat: 40.5656961, lng: -73.86996309999999},  
            ]
          }


  displayMarkers = () => {
    return this.state.beaches.map((beach, index) => {
      return <Marker key={index} id={index} position={{
        lat: beach.latitude,
        lng: beach.longitude
      }}
      onClick={() => console.log("You clicked me!")} />
    })
  }

  render() {
      return (
          <Map
          style={style}
          google={this.props.google}
          zoom={11}
          // style={{mapStyles}}
          initialCenter={{ lat: 40.5884, lng: -73.6579}}
          >
            {this.displayMarkers()}
          </Map>
      )
  }

}

const LoadingContainer = (props) => (
  <div>Fancy loading container!</div>
)

export default GoogleApiWrapper({
    apiKey: 'AIzaSyCrN9OLFD2SSP9_lYIqcGINzsOJ1iAJ7fM',
    LoadingContainer: LoadingContainer
  })(MapContainer);
